import React from 'react';
import { Link } from 'react-scroll';
import Home from './components/Home.jsx';
import Event from './components/Events.jsx';
import Book from './components/Booking.jsx';
import Contact from './components/Contact.jsx';
import Log from './components/Login.js';

import logo from './components/DK KD Logo.jpg';
import './App.css';

function App() {
  return (
    <div>
      {/* Navigation Bar */}
      <div className="navibar">
        <img className="logo" src={logo} alt="logo" />
        <Link className="home" to="home" smooth={true} duration={500}>HOME</Link>
        <Link className="event" to="event" smooth={true} duration={500}>EVENTS</Link>
        <Link className="booking" to="booking" smooth={true} duration={500}>BOOKING</Link>
        <Link className="login" to="login" smooth={true} duration={500}>LOGIN</Link>
        <Link className="contact" to="contact" smooth={true} duration={500}>CONTACT</Link>
      </div>

      {/* Main Content */}
      <div className="content">
        <section id="home">
          <Home />
        </section>
        <section id="event">
          <Event />
        </section>
        <section id="booking">
          <Book />
        </section>
        <section id="login">
          <Log />
        </section>
        <section id="contact">
          <Contact />
        </section>
      </div>
    </div>
  );
}

export default App;
